const dispatch_event = (eventName, detail) => {
    if (is_server_sice) {
        return
    }
    let event
    if (typeof window.Customvent === "function") {
        event = new window.Customvent(eventName, { detail })
    } else {
        event = document.createEvent("Event")
        event.initEvent(eventName, false, true)
        event.detail = detail
    }
    window.dispatchEvent(event)
}

