class HistoryStore {
    @observable.shallow list = []
    constructor(community) {
        if (!!community === false) {
            return
        }
        assert(is_object(community), "$community must be of type object")
        this.community = community

        const history_str = localStorage.getItem(`emoji.history.${community.id}`)
        if (!!history_str == false) {
            return
        }
        const shortnames = JSON.parse(history_str)
        if (Array.isArray(shortnames) === false) {
            return
        }
        if (shortnames.length > 0) {
            shortnames.forEach(emoji => {
                const { shortname, category } = emoji
                this.list.push({
                    shortname, category
                })
            })
        }
    }
    @action.bound
    add(shortname, category) {
        assert(is_string(shortname))
        assert(is_string(category))
        const list = []
        this.list.forEach(item => {
            if (shortname === item.shortname) {
                return
            }
            list.push(item)
        })
        list.unshift({ shortname, category })
        if (list.length > config.emoji.history.capacity) {
            list.pop()
        }
        this.list = list
        localStorage.setItem(`emoji.history.${this.community.id}`, JSON.stringify(list))
    }
}

class PickerStore {
    @observable is_searching = false
    @observable is_active = false
    @observable current_category = null
    @observable.shallow history = null
    @observable.shallow custom_shortnames = []
    constructor(community) {
        if (community) {
            this.community = community
            this.history = new HistoryStore(community)
        }
        manager.map_category_shortnames.custom.forEach(shortname => {
            this.custom_shortnames.push(shortname)
        })
        ws.addEventListener("message", event => {
            const data = JSON.parse(event.data)
            if (data.emoji_added) {
                const { shortname } = data
                assert(is_string(shortname), "@shortname must be of type string")
                manager.add_custom_shortnames([shortname])
                console.log(`New emoji :${shortname}: has been created`)
            }
            if (data.emoji_removed) {
                const { shortname } = data
                assert(is_string(shortname), "@shortname must be of type string")
                manager.remove_custom_shortnames([shortname])
                console.log(`Emoji :${shortname}: has been removed`)
            }
        })
        window.addEventListener(event_types.add, this.onAddCustomEmojiShortname)
        window.addEventListener(event_types.remove, this.onRemoveCustomEmojiShortname)
    }
    onAddCustomEmojiShortname = () => {
        this.updateCustomEmojiShortname()
    }
    onRemoveCustomEmojiShortname = () => {
        this.updateCustomEmojiShortname()
    }
    @action.bound
    updateCustomEmojiShortname = () => {
        manager.map_category_shortnames.custom.sort()
        const custom_shortnames = []
        manager.map_category_shortnames.custom.forEach(shortname => {
            custom_shortnames.push(shortname)
        })
        this.custom_shortnames = custom_shortnames
    }
    @action.bound
    show = (callback_pick, callback_hide) => {
        this.callback_pick = callback_pick
        this.callback_hide = callback_hide
        this.is_active = true
    }
    @action.bound
    hide = () => {
        if (this.callback_hide) {
            this.callback_hide()
        }
        this.callback_pick = null
        this.callback_hide = null
        this.is_searching = false
        this.is_active = false
    }
    pick = (shortname, category) => {
        if (this.history) {
            this.history.add(shortname, category)
        }
        if (this.callback_pick) {
            this.callback_pick(shortname, category)
        }
    }
    getEmojiHistory = () => {
        if (this.history) {
            return this.history.list
        }
        return []
    }
    @action.bound
    setCurrentCategory = category => {
        this.current_category = category
    }
    @action.bound
    setIsSearching = is_searching => {
        this.is_searching = is_searching
    }
}

class Empty {
    getEmojiHistory = () => {
        return []
    }
    setCurrentCategory = category => { }
}

const get_picker_class = () => {
    if (typeof localStorage === "undefined") {
        return Empty
    } else {
        return PickerStore
    }
}

export const EmojiPickerStore = get_picker_class()

const map_server_picker = {}
export const get_shared_picker_store = community => {
    if (!!community === false) {
        return new (get_picker_class())()
    }
    let picker = map_server_picker[community.id]
    if (picker) {
        return picker
    }
    picker = new (get_picker_class())(community)
    map_server_picker[community.id] = picker
    return picker
}